import './App.css';
import Header from "./components/Header";
import Body from "./components/Body";
import {BrowserRouter, Link, Routes, Route} from "react-router-dom";

function App() {
    return (
        <>
            <div className="App">
                <BrowserRouter>
                    <Header/>
                    <Routes>
                        <Route/>
                        <Route/>
                    </Routes>
                    <Header/>
                    <Body/>
                </BrowserRouter>
            </div>
        </>
    );
}

export default App;
